import React from 'react';
import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';
import Theme from '../../components/providers/ThemeProvider';
import { Grid2 as Grid, Typography, ThemeProvider } from '@mui/material';
import Image from '../../components/common/Image';
import starImage from '../../assets/star.png';

export default function Homepage() {

  return (
    <ThemeProvider theme={Theme}>
      <Grid container 
        sx = {{
          minHeight: "100vh",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Grid item position="relative" zIndex={1}>
        <Typography variant="hero2" 
          sx = {{
            zIndex: 2,
            position: "absolute",
            right: "32%",
            top: "32%",
            color: "#FBFBFB",
            WebkitTextStroke: "1px #88FFDB",
          }}
        >
          dani‚ùänina
        </Typography>
        <Typography variant="hero1">
          PORTFOLIO
        </Typography>
        <Typography variant="h2" 
          sx = {{
            position: "absolute",
            bottom: -20,
            textAlign: "center",
            width: "100%"
          }}
        >
          web development and graphic design
        </Typography>
        <Image src={starImage} 
          sx={{
            position: "absolute", bottom: -30, right: -80,
            width: "50px", height: "80px",
          }}
        />
        <Image src={starImage} 
          sx={{
            position: "absolute", top: -20, left: -80,
            width: "50px", height: "80px",
          }}
        />
        <div
          style={{
            width: "1152px",
            height: "820px",
            background: "radial-gradient(circle, #88FFDB 0%, transparent 50%)",
            zIndex: 0,
            position: "absolute", // Ensure it is properly layered
          }}
        />
        </Grid>
      </Grid>
    </ThemeProvider>
  )
}

reportWebVitals();
